class Home extends Component {
	 render() {
	 	return (
	 	<>
	 	<Hero>
	 		<Banner title="Luxurious Rooms" subtitle="Deluxe rooms starting at $298">
	 		<Link to="/rooms" className="btn-primary">
	 		our Rooms
	 		</Link>
	 	 	</Banner>
	 	 </Hero>
	 	 </>
	 	);
	}
}
export default Home;
